import {doPostAsync} from "../http/http";
import authHeader from "../user/auth-header";

import { ip, tomcatPort } from "../../misc/constants";

const URL = `http://${ip}:${tomcatPort}/api/charger`

/**
 * This service gets all the chargers as well as their state from the backend
 * @author Sven
 * @version 06/08/2021
 */
const fetchChargers = () => {
    return doPostAsync(`${URL}/getAllChargers`, null, authHeader());
};

export { fetchChargers }
